import React from 'react'
import './About.css'
import { Image } from 'react-bootstrap';
import bg from '../image/me3.png';

const About = () => {
    return (
        <div style={{ width: 'auto' }}>
            <Image style={{ width: 'auto' }} responsive src={bg}>
                This is a test
                </Image>
        </div>
    )
}
export default About;
